import React, { useEffect, useState } from "react";
import s from "./Cars.module.css";
import pic1 from "./woodoo-crop-300x300.jpg";
import pic2 from "./bd676c9e9c2f4213e21ffb367de77e93.jpg";
import pic3 from "./crop3.jpg";
import { NavLink } from "react-router-dom";
import Booking from "../OnlineBooking/Booking";
import { useHistory } from 'react-router-dom';
import { Table } from 'reactstrap';




export default function Cars(props) {
    const history = useHistory();
    const [cars, setCars] = useState([]);

    async function getCars(e){
        //e.preventDefault();

        let res = await fetch("https://localhost:44312/api/Car", {
            method: 'GET',
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
                "Authorization": "Bearer "+ localStorage.getItem("tok"),
            },
        });
        setCars();
        console.log(cars);
        console.log(res);
        console.log(res.status);
        if(res.status === 200){
            //history.push("/login")
        }


        res = await res.json();
        //console.log(res);

        let names = [];

       for(var i in res ){
           names[i] = res[i];
           
       }
       setCars(names);
       console.log(cars);
       console.log(names);
       localStorage.setItem("cars", JSON.stringify(names));
    } 
   
    function printCars(){
       getCars();      
        var items = JSON.parse(localStorage.getItem("cars"));    
        localStorage.setItem("opa", items);
    };
   
   
   //printCars();
   


    return (
        <div>
         
        <table>
           <thead>
               <tr>
                   <th>Model</th>
                        <th>Brand</th>
                        <th>Year</th>
                        <th>Transmission</th>
                        <th>Address</th>
                        <th>Type</th>
                        <th>Price</th>
                        <th>Description</th>
                </tr>
            </thead>
            <tbody>
        
                { items.map(item => { 
                    return (

                            <tr>  
                                 <td>{item.model}</td>
                                 <td>{item.brand}</td>
                                  <td>{item.year}</td>
                                    <td>{item.transmission}</td>
                                    <td>{item.address}</td>
                                    <td>{item.type}</td>
                                    <td>{item.price}</td>
                                    <td>{item.description}</td>
                            </tr>
                        );
                })}

            </tbody>
        </table>
        
        </div>
    );
};
